import { 
	StyledProjectTile, 
	StyledAllProjects, 
	SquareOne, 
	SquareTwo, 
	SquareThree, 
	SquareFour, 
} from "../styles/StyledProjectTile";

type propTypes = {
	project: { 
    name: string,
    img: string,
    link: string
  },
}

function handleTileClick(linksrc: string) {
  window.open(linksrc, "_blank");
}

export const ProjectTile = ( { project }:propTypes ) => {
	return (
		  <StyledProjectTile src={require(project.img)} alt={project.name} onClick={() => handleTileClick(project.link)} />
	)
}

export const AllProjects = () => {
	return (
		<StyledAllProjects id="All Projects">
			<SquareOne/>
			<SquareTwo/>
			<SquareThree/>
			<SquareFour/>
		</StyledAllProjects>
	)
}
